import React from 'react'

const Cart=(todo)=>{
    return(
    <>
        <div className="container bg-danger">
            <div class="card w-100" >
                <img src={todo.img} class="card-img-top" alt="..."/>
                <div class="card-body">
                    <h5 class="card-title">todo.name</h5>
                    
                </div>
            </div>
        </div>
    </>
    )
}

export default Cart;
